import { updateObject } from '../../Shared/Utility';

const initialState = {
    userId: null
};

const reducer = ( state = initialState, action ) => {
    switch ( action.type ) {
        case actionTypes.AUTH_START: return authStart(state, action);
        default:
            return state;
    }
};

export default reducer;
